#
# Procedure "deleteDeadVehicles"
#

DROP PROCEDURE IF EXISTS `deleteDeadVehicles`;
CREATE PROCEDURE `deleteDeadVehicles`()
BEGIN
  DELETE FROM `vehicles` WHERE `alive` = 0;
END;

#
# Procedure "deleteOldContainers"
#

DROP PROCEDURE IF EXISTS `deleteOldContainers`;
CREATE PROCEDURE `deleteOldContainers`()
BEGIN
  DELETE FROM `containers` WHERE `owned` = 0;
END;

#
# Procedure "deleteOldGangs"
#

DROP PROCEDURE IF EXISTS `deleteOldGangs`;
CREATE PROCEDURE `deleteOldGangs`()
BEGIN
  DELETE FROM `gangs` WHERE `active` = 0;
END;

#
# Procedure "deleteOldHouses"
#

DROP PROCEDURE IF EXISTS `deleteOldHouses`;
CREATE PROCEDURE `deleteOldHouses`()
BEGIN
  DELETE FROM `houses` WHERE `owned` = 0;
END;

#
# Procedure "deleteOldWanted"
#

DROP PROCEDURE IF EXISTS `deleteOldWanted`;
CREATE PROCEDURE `deleteOldWanted`()
BEGIN
  DELETE FROM `wanted` WHERE `active` = 0;
END;

#
# Procedure "resetLifeVehicles"
#

DROP PROCEDURE IF EXISTS `resetLifeVehicles`;
CREATE PROCEDURE `resetLifeVehicles`()
BEGIN
  UPDATE `vehicles` SET `active`= 0;
END;
